import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

const MyMap = () => {
    return (
        <LoadScript googleMapsApiKey="AIzaSyBAz3NgvETAjFMzP88Q86sJRfLyJj0P0_g">
            <GoogleMap center={{ lat: 46.17216363431004, lng: 21.548133125659472 }}
                zoom={7}
                options={{ mapTypeControl: false, }}
                mapContainerStyle={{ height: "600px", width: "1000px" }}>
                <Marker position={{ lat: 46.1438333333333, lng: 18.1181666666667 }} />
            </GoogleMap>
        </LoadScript>
    );
};

export default MyMap;
